import SubMenu from './SubMenu'

function NavMenu(props) {
 const mysub= ()=>{
  if (props.childitem !== undefined) {
    return "abc"
  }
 }
  return (
    <li className= {`navitem relative ${mysub}`}><a className="navitem__link " href="#">{props.navItem} </a>  {props.childitem !== undefined ? <SubMenu childitem={props.childitem} /> : "" }</li>
  )
}

export default NavMenu
